import '../styles/Dropdown.css'

function Dropdown({title}, {details}){
    return (
        <div className="dropdown">
            <div className="dropdown__title">
                ${title}
            </div>
            <div className="dropdown__details">
                ${details}
            </div>
        </div>
    )
}

export default Dropdown
